  const [currentForm, setCurrentForm] = useState('login');

  const toggleForm = (formName) => {
    setCurrentForm(formName);
  }
  return (
    <div className="App">
      {
        currentForm === "login" ? < Login onFormSwitch={toggleForm}/> : <Register />
      }
      {/* <Login />
      <Register /> */}
    </div>
  );
}

export default App;
